    "description": "\u2018Thai Country Living\u2019 <br />\n\u0e2d\u0e22\u0e39\u0e48\u0e1a\u0e49\u0e32\u0e19\u0e19\u0e2d\u0e01\u2060<br />\n<br />\n\u2018Thai Country Living\u2019 is about the special way of life in Thailand\u2019s north east Isaan region. A place which transports you to a timeless world far away from modern Bangkok. Friendship, family, community, pride - and celebration after a hard days work - are the rhythms that make the village tick. <br />\n<br />\nThe film shares the life of Suman - a farmer and craftsman dedicated to the traditional ways of country living. Suman is an important part of village life - with the instruments he makes being essential in celebrations, get togethers, birthdays and drinking sessions. <br />\n<br />\nIn a time when global culture is slowly eroding unique traditions, we wanted to celebrate a simpler and more authentic way of life we found in Suman\u2019s peaceful and mediative world.<br />\n<br />\nFull of energy and human warmth - this film is a thank-you to all the amazing Thai folks that have introduced us to their culture in the most welcoming and warming of ways - through good food, traditional music, friendship\u2026 and whiskey.<br />\n<br />\nWinner \u2018Best Original Music\u2019 Mosaic Film Festival 2020<br />\nWinner \u2018Best Sound\u2019 Mosaic Film Festival 2020<br />\nFinalist Canada Shorts Film Festival 2020<br />\nSemi-Finalist Top Shorts Film Festival 2020<br />\nOfficial Selection 9Film Fest 2020<br />\nOfficial Selection Sonic Scene Music Film Festival 2020<br />\nOfficial Selection AmDocs Film Festival 2021<br />\n<br />\nDirector: Tubby Brother<br />\nDOP: Dan Tubby<br />\nEditor: Ben Tubby<br />\nComposer: Rob Law<br />\nColourist: Simone Grattarola @ Time Based Arts<br />\nSound Design: Martin Leitner @ Wave",
