    "id": 530298833,
    "title": "The Revolt",
    "description": "An empty, immaculate high-end residence. Every design object and piece of furniture occupies a specific, calculated space. The utility doesn't seem to matter or take place, the form's smoothness and perfection is everything. Everything is calm, perfect, the light embraces the space and its beautiful design. But there are other objects that escape that standard, that are of a different kind. Objects that inhabit every house, purely functional or that simply clash with the aesthetic pretension of the environment. Used and left aside, hidden, concealed, disguised, made invisible, as if they were shameful. These are the ones who break into the aseptic landscape and take it by storm. A blow worthy of a class struggle, where a useful minority rebels against pretension and sets out to tear down its symbols.<br />\n<br />\n<br />\nA short film by Six N. Five<br />\n<br />\nIdea and Direction<br />\nEzequiel Pini & Sebastian Baptista<br />\n<br />\nArt Direction<br />\nEzequiel Pini, Joan Garcia Pons<br />\n3D Design<br />\nJoan Garcia Pons, Ezequiel Pini, Joan Guasch, Secondary Bounce, Simon Ka\u00ebmpfer.<br />\n<br />\nVisual storytelling<br />\nSebastian Baptista<br />\nAnimation & VFX<br />\nNil Estany, Valery Polehenky, Sebastian Baptista &, Jo\u00e3o Lucas<br />\n<br />\n<br />\nSound by Cypher featuring the music of Georgia<br />\nEditing by Lluis Murua<br />\n<br />\nVR Experience<br />\nSecondary Bounce - Mauro Mu\u00f1oz & Miguel Segovia -<br />\nSelected furniture & objects<br />\nSix N. Five Objects - Artur de Menezes & Ezequiel Pini <br />\n<br />\nPress copy by Pedro Merlo<br />\nThanks to Flor Clerico, Dai Ventrice, Paola Zanni and the team.",
