    "title": "Conceptions",
    "description": "Available as NFT at https://makersplace.com/gregcooperrr/<br />\n<br />\nConceptions is an excursion of the fundamentals that underpin creativity. Three kinetic sculptures represent the development of ideas as they converge from noise to pattern.<br />\n<br />\nIdeate<br />\nA shape with innumerable sides swirls chaotically, gradually giving rise to tangible structures that can be shaped and understood.<br />\n<br />\nDistill<br />\nThe resulting structures are studied with care here. Apexes are weighted and imperfections are diffused. Each iteration developing unique attributes.<br />\n<br />\nSurrender<br />\nThis is the summit of form. Unapologetic in its dimensions, the structure exists in perpetuity, liberated from revision.<br />\n<br />\nSound Design by Timon Martin",
