    "title": "All Bodies On Bikes",
    "description": "Kailey Kornhauser and Marley Blonsky are on a mission - a mission to change the idea that people in larger bodies can't ride bikes. The duo aims to make cycling more inclusive, beyond just inviting people of all sizes to ride bikes, but by changing the entire idea of what it means to be a cyclist \u2014 not just on screens, but on trails and in people\u2019s minds.<br />\n<br />\nDirector: Zeppelin Zeerip<br />\nProducer: Zac Ramras<br />\nDirector of Photography: Michael Brown<br />\nEditor: Michael Brown<br />\nSound Design: Avery Sandack<br />\nAnimation: Studio Dialog<br />\nStarring: Kailey Korhauser <br />\nMarley Blonsky<br />\nMusic: Easy Giant<br />\nRigger: Kyle Metzger<br />\n<br />\nNative Lands: Duwamish, Coast Salish, Kalapuya, Chemapho, Confederated Tribes of Grand Ronde, Alsea, Tillamook, Siletz, and Yakina.<br />\n <br />\nAdditional Thanks: Corvallis Bicycle Collective, Black Rock Mountain Bike Association, Velo Orange, Free Range Bike Shop",
