    "description": "The Great Bear Rainforest in British Columbia is a naturally rich and diverse land home to many indigenous People. Like other areas in the country rich in natural resources, the land and its people have been and continue to be threatened by government regulation, restriction, and resource extraction. This documentary explores the perspectives of Mike Willie and K\u0315odi Nelson, two Indigenous men looking to conserve their land, protect their culture and heritage, bring prosperity and respect to their people, and find harmony and reconciliation between Indigenous People and the Canadian government once and for all.<br />\n<br />\nhttps://tv.booooooom.com/2021/03/22/seawolf-alexander-sworik/<br />\n<br />\nTo learn more visit:<br />\n<br />\nhttps://seawolfadventures.ca<br />\nhttps://nawalakw.com<br />\n<br />\nDirector: Alexander Sworik<br />\nDirector of Photography: Christopher Clark<br />\nColourist: Parker Jarvie<br />\nColour Producer: Blake Rice<br />\nSound Design and Mixing: Alastair Sims<br />\nTitling: Johnny Del Guercio <br />\nAdditional Aerial Footage: Zachary Moxley<br />\nPhotography: Taylor Burk<br />\n<br />\nSpecial Thanks to:<br />\nMike Willie<br />\nK\u2019odi Nelson",
